import "bootstrap/dist/css/bootstrap.min.css";
import styled from "styled-components";

import { Button, Navbar, Container, Nav, Row, Col } from "react-bootstrap";

let Title = styled.div`
  font-size: 2rem;
  padding: 0.5rem;
  text-align: center;
  background-color: grey;
  border-radius: 1rem;
  width: 50%;
  color: darkgrey;
`;
let CenterBox = styled.div`
  text-align: center;
`;

function App() {
  return (
    <div className="App">
      <Navbar className="bg-body-tertiary">
        <Container>
          <Navbar.Brand href="#home">Music SNS</Navbar.Brand>
        </Container>
      </Navbar>
      <centerBox>
        <Title>검색</Title>
      </centerBox>
    </div>
  );
}

export default App;
